const AUTH_TOKEN ='Bearer eyJhbGciOiJIUzI1NiJ9.TmV3c0JhbmtBZG1pblBhbmVs.9Bc5SJei_sd1BiSXVhWHc4HzdGzlKURD00KZVDP7utc';

const Axios = axios.create({
    baseURL:Url,
})

Axios.defaults.headers.common['Authorization'] = AUTH_TOKEN;

